  <style>
    html, body {
      margin: 0;
      padding: 0;
      background-color: #f04d23;
      font-family: Arial, sans-serif;
      overflow: hidden;
    }
    #loader {
      position: fixed;
      top: 50%;
      left: 50%;
      width: 60px;
      height: 60px;
      margin: -30px 0 0 -30px;
      border: 6px solid #f3f3f3;
      border-top: 6px solid #ffcc00;
      border-radius: 50%;
      animation: spin 1s linear infinite;
      z-index: 9999;
    }
    @keyframes spin {
      0% { transform: rotate(0deg); }
      100% { transform: rotate(360deg); }
    }
    @keyframes shake {
      0% { transform: translate(1px, 1px) rotate(0deg); }
      10% { transform: translate(-1px, -2px) rotate(-1deg); }
      20% { transform: translate(-3px, 0px) rotate(1deg); }
      30% { transform: translate(3px, 2px) rotate(0deg); }
      40% { transform: translate(1px, -1px) rotate(1deg); }
      50% { transform: translate(-1px, 2px) rotate(-1deg); }
      60% { transform: translate(-3px, 1px) rotate(0deg); }
      70% { transform: translate(3px, 1px) rotate(-1deg); }
      80% { transform: translate(-1px, -1px) rotate(1deg); }
      90% { transform: translate(1px, 2px) rotate(0deg); }
      100% { transform: translate(1px, -2px) rotate(-1deg); }
    }
    .shake {
      animation: shake 0.3s infinite;
    }
    #main-content {
      display: none;
      position: relative;
      z-index: 10;
      height: 100vh;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
    .content-wrapper {
      position: relative;
      text-align: center;
    }
    .cat-logo {
      max-width: 90vw;
      max-height: 50vh;
    }
    .side-button {
      position: absolute;
      top: 50%;
      transform: translateY(-50%);
      padding: 20px 30px;
      font-size: 18px;
      background-color: #ffcc00;
      border: none;
      border-radius: 10px;
      font-weight: bold;
      cursor: pointer;
    }
    .left-btn {
      left: -220px;
    }
    .right-btn {
      right: -220px;
    }
    .bottom-btn {
      margin-top: 30px;
      padding: 20px 50px;
      font-size: 20px;
      background-color: #ffcc00;
      border: none;
      border-radius: 12px;
      font-weight: bold;
      cursor: pointer;
    }
    canvas {
      position: fixed;
      top: 0;
      left: 0;
      z-index: 1;
      pointer-events: none;
    }
  </style>
</head>

  <audio id="meowSound">
    <source src="https://www.soundjay.com/animal/cat-meow-1.mp3" type="audio/mpeg" />
  </audio>

  <script>
    function initSound() {
      document.body.removeAttribute("onclick");
      document.getElementById("meowSound").play();
    }
    function playMeow() {
      const audio = document.getElementById("meowSound");
      audio.currentTime = 0;
      audio.play();
    }
    let meowMode = false;
    function toggleMeowMode() {
      meowMode = !meowMode;
      document.body.classList.toggle("shake", meowMode);
      playMeow();
    }
    window.addEventListener("DOMContentLoaded", () => {
      setTimeout(() => {
        document.getElementById("loader").style.display = "none";
        document.getElementById("main-content").style.display = "flex";
        startFalling();
      }, 1500);
    });

    // Falling emojis
    const canvas = document.getElementById('fallingCanvas');
    const ctx = canvas.getContext('2d');
    let items = [];
    function randomImage() {
      return Math.random() > 0.5 ? '' : '';
    }
    function resizeCanvas() {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
    }
    function startFalling() {
      resizeCanvas();
      for (let i = 0; i < 30; i++) {
        items.push({
          x: Math.random() * canvas.width,
          y: Math.random() * canvas.height,
          speed: 1 + Math.random() * 3,
          char: randomImage(),
          size: 24 + Math.random() * 20
        });
      }
      requestAnimationFrame(draw);
    }
    function draw() {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      for (let item of items) {
        ctx.font = `${item.size}px Arial`;
        ctx.fillText(item.char, item.x, item.y);
        item.y += item.speed;
        if (item.y > canvas.height) {
          item.y = -30;
          item.x = Math.random() * canvas.width;
          item.char = randomImage();
        }
      }
      requestAnimationFrame(draw);
    }
    window.addEventListener('resize', resizeCanvas);
  </script>
